// Loads object literals from existing external script into compatible module export
var vm = require("vm"),
    fs = require("fs"),
	context = {};

// Load js into buffer
var data = fs.readFileSync('../chrome/examples.js');

// Execute js into context (third param is the logical name for stack msg on exceptions)
vm.runInNewContext(data, context, 'runInNewContext-logical.vm');

// return results
module.exports = context;